import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <h1>Mon Blog</h1>
      <nav>
        <ul>
          <li><Link to="/">Accueil</Link></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
